import React from 'react';

const WTCImage1 = () => {
  const imageUrl = 'https://mma.prnewswire.com/media/704442/WTCA_Logo.jpg?w=200';

  return (
    <div
      style={{
        backgroundImage: `url(${imageUrl})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundRepeat: 'no-repeat',
        width: '100vw',
        height: '100vh',
         backgroundAttachment: 'fixed',
        position: 'absolute',
      }}
    />
  );
};

export default WTCImage1;
